import React from "react";

export default function HoverCounter({ count, incrementCount, theme }) {
  const style =
    theme === "dark" ? { backgroundColor: "#0000", color: "#fffff" } : "null";

  return (
    <div style={style}>
      <h1 onMouseOver={incrementCount}>Hoverd {count} times</h1>
    </div>
  );
}
